import React from 'react';
import Image from '../../../assets/icon modalidades/AdminPage.jpg';
// import Sidebar from '../SideBarAdmin';
class Admin extends React.Component {
    render() {
        return (
            <div>
            <div >
                <img src={Image} style={{marginLeft:'250px',height:'600px',width:'1200px'}}></img>
            </div>
            </div>
            
        );
    }
}
export default Admin;
